import React from 'react';
import { useBluetooth } from '../BluetoothContext';

function SendBluetoothData() {
  const { sendBluetoothData } = useBluetooth();

  const sendData = () => {
    // Send data to the Bluetooth device
    sendBluetoothData('Your data here');
  };

  return (
    <div>
      <button onClick={sendData}>Send Data</button>
    </div>
  );
}

export default SendBluetoothData;
